import './Home.css';
import homeImg from './images/home-img.svg';

const Home = () => {
  return (
    <section className="home" id="home">
      <div className="image">
        <img src={homeImg} alt="" />
      </div>
      {/* ... rest of the code */}
    </section>
  );
};

export default Home;
